resource/PlaybackProcess.html.body:
存储卡回放
涂鸦 IPC 摄像机支持 SD卡录制功能，智能摄像机插入存储卡后，可以查看存储卡的信息和状态，并设置录像开关和模式，详情可以参考 存储卡管理功能。
存储卡回放是 Tuya Smart Camera Android SDK 通过云端服务器信息，接着创建 ICameraP2P 对象，然后进行 P2P 连接后，就可以播放摄像机 SD 卡录制下来的视频了。
主要链路代码
1. 初始化
ICameraP2P需要绑定 Monitor，使用者要创建 ICameraP2P 和 Monitor ，同时也需要注册OnP2PCameraListener。如下所示
private static final int ASPECT_RATIO_WIDTH = 9;
private static final int ASPECT_RATIO_HEIGHT = 16;
@Override
protected void onCreate(Bundle savedInstanceState) {
  ···
    initView();
  initData();
  initListener();
  ...
}
private void initView() {
  ...
    mVideoView = findViewById(R.id.camera_video_view);
  ...

    //播放器view最好宽高比设置16:9
    WindowManager windowManager = (WindowManager) this.getSystemService(WINDOW_SERVICE);
  int width = windowManager.getDefaultDisplay().getWidth();
  int height = width * ASPECT_RATIO_WIDTH / ASPECT_RATIO_HEIGHT;
  RelativeLayout.LayoutParams layoutParams = new RelativeLayout.LayoutParams(width, height);
  layoutParams.addRule(RelativeLayout.BELOW, R.id.toolbar_view);
