云台控制
涂鸦云台摄像机可以通过 Tuya Smart Camera Android SDK 远程控制其向指定方向转动。

SDK 控制云台机转动时，并不是单位角度转动。SDK 下发开始转动的命令后，设备会朝着指定方向一致转动，直到无法转动，或者收到停止转动的命令。

